<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
<script>
    const a = {}
    const b = { key: 'b' }
    const c = { key: 'c' }
    a[b] = 123
    a[c] = 456
    // a[{ key: 'b' }] = 123
    // a[{ key: 'c' }] = 456
    console.log(a[b]); // 456
    console.log(a); // {[object Object]: 456}
</script>
</body>
